import React from 'react';
import './Product.css';

const Product = ({ product, addToCart }) => {
    return (
        <div className="product-card">
            <h3>{product.name}</h3>
            <p>{product.description}</p>
            <p>${product.price}</p>
            <button onClick={() => addToCart(product.id)}>Add to Cart</button>
        </div>
    );
};

export default Product;
